package datatypes;

public class DataTypes {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		long ln = 3453543554l;
		float f = ln;
		System.out.println(f);
		
		char ch = 65; 
		
		System.out.println(ch);
		
		ch = 'B';
		
		System.out.println(ch);
		
		int ab = ch;
		
		System.out.println(ab);
		
		
		ch = 102;
		System.out.println(ch);

	}

}
